import classes from "./Rooms.module.css";
import classNames from "classnames";
function UkrainianRoomsSecondFloor(props) {
  return (
    <div className={classes.secondFloorBackground}>
      <div className={classes.contentWrapper}>
        <p
          className={classNames(
            classes.mainText,
            classes.firstFloorDescription
          )}
        >
          На другому поверсі — 2 двомісні номери (двоспальне або 2 односпальні
          ліжка, шафа для одягу); тримісний номер (3 односпальні ліжка, шафа для
          одягу); 1 санвузол (душова кабіна, туалет, умивальник, фен). Опалення:
          автономне водяне. Водопостачання: холодна та гаряча вода постійно.
        </p>
        <img
          className={classes.image8}
          src={require("../img/image8.png")}
          alt="вид з садиби"
        />
        <img
          className={classes.image7}
          src={require("../img/image7.png")}
          alt="вид з садиби"
        />
        <p className={classNames(classes.mainText, classes.roomPrices)}>
          Можно зняти окрему кімнату або усю садибу: <br></br>двомісний номер -
          900 ₴ за ніч <br></br>тримісний номер - 1200 ₴ за ніч <br></br>садиба
          - 2500 ₴ за ніч
        </p>
        <img
          className={classes.image9}
          src={require("../img/image9.png")}
          alt="вид з садиби"
        />
      </div>
    </div>
  );
}
export default UkrainianRoomsSecondFloor;
